import { useEffect } from "react";

function UserEventosList({ user }) {
    useEffect(() => {
    }, [user]);
    return (
        <>
        { user.estado === 1 ? (
            <li className="list-group-item px-4 py-1">
                {user.name} {user.lastName}
            </li>
        ) : (
            <></>
        )}
        </>
    );
}
export default UserEventosList;
